import {Home, Anchor, Headphones} from 'react-feather'
export const MENUITEMS = [
    {
        Items:[
            {
                title: 'Admin', 
                icon: Home, 
                type: 'sub', 
                active: false, 
                children: [
                    { 
                        path: `${process.env.PUBLIC_URL}/dashboard/default`, 
                        title: 'Default', 
                        type: 'link' 
                    },

                    { 
                        path: `${process.env.PUBLIC_URL}/dashboard/ecommerce`, 
                        title: 'Ecommerce', 
                        type: 'link' 
                    },
                ]
            }
        ]

    },
    {
        Items:[
            {
                title: 'Starter kit', 
                icon: Anchor, 
                type: 'sub', 
                active: false, 
                children: [
                    {
                        path: `${process.env.PUBLIC_URL}/starter-kits/sample-page`, 
                        title: 'Sample Page', 
                        type: 'link' 
                    },
                ]
            }
        ]
    },
    {
        Items:[
            {
                title: 'Raise Support', 
                icon: Headphones, 
                type: 'sub',
                active: false, 
                children: [
                    { title: 'Raise Ticket', type: 'exteral_link', path: 'http://support.pixelstrap.com/help-center' },
                ]
            }
        ]          
    },


]
